import PropTypes from 'prop-types';
import ItemStyles from '../styles/ItemStyles';

export default function Product({ product }) {
  console.log(product);
  return <ItemStyles>{/* <img src={product} /> */}</ItemStyles>;
}

Product.propTypes = {
  product: PropTypes.object,
};
